import React from 'react';
import ReactDOM from 'react-dom';
import { HashRouter } from 'react-router-dom';
import './index.css';
import Routes from './Routes'

ReactDOM.render(
  <HashRouter>
       <div className="App">
         <Routes />
       </div>
  </HashRouter>,
  document.getElementById('root')
);
